from __future__ import division
import json
from sys import stdin
from sys import stderr
import copy
import math

def gets(inps, outps, anss):
    # returns number between 0 and 1 (score for this test).
    inp = inps.strip().split("\n")
    out = outps.strip().split("\n")
    ans = anss.strip().split("\n")

    def isint(value):
        try:
            int(value)
            return True
        except ValueError:
            return False

    def getints(number, line):
        ints = []
        linesplit = line.strip().split()
        if len(linesplit) != number:
            return [None]*number
        for num in linesplit:
            if not isint(num):
                return [None]*number
            ints.append(int(num))
        return ints

    _N = map(int,inp[0].strip().split())[0]
    _A = []
    for i in xrange(_N):
        _A.append(list(map(int,inp[i + 1].strip().split())))

    AAA = 0
    for i in xrange(_N):
        for j1 in xrange(_N):
            for j2 in xrange(j1 + 1,_N):
                AAA += (_A[i][j1] < _A[i][j2])

    for j in xrange(_N):
        for i1 in xrange(_N):
            for i2 in xrange(i1 + 1,_N):
                AAA += (_A[i1][j] < _A[i2][j])

    if len(out) < 1:
        return 0

    M = getints(1, out[0])[0]
    if M == None or M < 0 or M > 500:
        return 0
    if len(out) != M + 1:
        return 0

    def rtt(x,y,z,A):
        B = [[0]*z for i in xrange(z)]
        for i in xrange(z):
            for j in xrange(z):
                B[j][z - 1 - i] = A[x + i][y + j]
        for i in xrange(z):
            for j in xrange(z):
                A[x + i][y + j] = B[i][j]

    for i in xrange(1, M + 1):
        x, y, z = getints(3,out[i])
        if (1 <= x and x <= _N and
            1 <= y and y <= _N and
            2 <= z and z <= _N and
            x + z <= _N + 1 and y + z <= _N + 1):
            rtt(x - 1, y - 1, z, _A)
        else:
            return 0

    BBB = 0; CCC = _N * _N * (_N - 1)

    for i in xrange(_N):
        for j1 in xrange(_N):
            for j2 in xrange(j1 + 1,_N):
                BBB += (_A[i][j1] < _A[i][j2])

    for j in xrange(_N):
        for i1 in xrange(_N):
            for i2 in xrange(i1 + 1,_N):
                BBB += (_A[i1][j] < _A[i2][j])

    if BBB < AAA:
        return 0

    return (BBB - AAA)/(CCC - AAA)

def check_inputs (inputs, outputs, answers):
    lis = []
    for inps, outps, ans in zip(inputs, outputs, answers):
        lis.append(gets(inps, outps, ans))
    return lis

def process(data):
    # Whatever you do, I am not giving any marks!
    score = 0

    b = check_inputs(data["inputs"], data["outputs"], data["expected_outputs"])
    if len(b)==1:
        score = sum(b)/len(b)
    else:
        score = sum(b[1::])/len(b[1::])
    for i in xrange(len(b)):
        if b[i]>0.000001:
            b[i] = 1
    return math.ceil(100.0 * score) / 100.0, b

if __name__ ==  '__main__':
